import React, { Component } from 'react';
import '../App.css';
import books from '../books.json';
import ItemCard from './ItemCard';
import axios from 'axios';

class App extends Component {

  render() {



    return (
      <div>
        {
          books.map((book, key) => (
            <ItemCard key = {key} {...book} /> 
          ))
        }
      </div> 
    );
  }
}

export default App;
